string soapEnvelope = @"<?xml version=""1.0"" encoding=""utf-8""?>  
<soapenv:Envelope xmlns:soapenv=""http://schemas.xmlsoap.org/soap/envelope/"" xmlns:ffor=""https://www.formfox.com/v2/ffordersvc"">  
   <soapenv:Body>
      <ffor:CreateOrder>
